import React, { Suspense } from "react";
import { BrowserRouter as Router, Routes, Route, Link, Switch } from "react-router-dom";
import Navbar from "./page/Navbar";
import Footer from "./page/Footer";

const SuspenseFallback = () => <div>Loading...</div>;

const PaginaPrincipal = React.lazy(() => import("./page/PaginaPrincipal"));
const About = React.lazy(() => import("./page/About"));
const Services = React.lazy(() => import("./page/Services"));
const ContactForm = React.lazy(() => import("./page/ContactForm"));
const CybersecurityStats = React.lazy(() => import("./page/CybersecurityStats"));
const Partners = React.lazy(() => import("./page/Partners"));
const PrivacyPolicy = React.lazy(() => import("./page/PoliticaPrivacidad"));
const TermsAndConditions = React.lazy(() => import("./page/TermsAndConditions"));
const CookiesPolicy = React.lazy(() => import("./page/CookiesPolicy"));
const NotFoundComponent = React.lazy(() => import("./page/NotFound"));

function App() {
  return (
    <React.StrictMode>
      <Router>
        <Navbar />
        <Suspense fallback={<SuspenseFallback />}>
          <Switch>
            <Route path="/" element={<PaginaPrincipal />} />
            <Route path="/about" element={<About />} />
            <Route path="/services" element={<Services />} />
            <Route path="/contact" element={<ContactForm firestore={firestore} />} />
            <Route path="/cybersecurity" element={<CybersecurityStats />} />
            <Route path="/partners" element={<Partners />} />
            <Route path="/privacy" element={<PrivacyPolicy />} />
            <Route path="/terms" element={<TermsAndConditions />} />
            <Route path="/cookies" element={<CookiesPolicy />} />
            <Route path="*" element={<NotFoundComponent />} />
          </Switch>
        </Suspense>
        <Footer />
      </Router>
    </React.StrictMode>
  );
}

export default App;
